import React from "react";
import { useNavigate } from "react-router-dom";
import { useTranslation } from "react-i18next";

export default function LandingPage() {
  const navigate = useNavigate();
  const { t, i18n } = useTranslation(); // ‚úÖ Fixes changeLanguage bug

  const toggleLanguage = () => {
    const nextLang = i18n.language === "en" ? "sw" : "en";
    i18n.changeLanguage(nextLang); // ‚úÖ This now works!
  };

  const features = [
    {
      title: t("feature1_title"),
      description: t("feature1_desc"),
      icon: "üìÑ",
    },
    {
      title: t("feature2_title"),
      description: t("feature2_desc"),
      icon: "üìä",
    },
    {
      title: t("feature3_title"),
      description: t("feature3_desc"),
      icon: "üîí",
    },
    {
      title: t("feature4_title"),
      description: t("feature4_desc"),
      icon: "üì±",
    },
    {
      title: t("feature5_title"),
      description: t("feature5_desc"),
      icon: "üá∞üá™",
    },
    {
      title: t("feature6_title"),
      description: t("feature6_desc"),
      icon: "üéÅ",
    },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-500 to-purple-600 text-white font-sans">
      {/* Header */}
      <header className="flex justify-between items-center p-6 bg-blue-700 shadow-md">
        <h1 className="text-2xl font-bold">üßæ KRA iTax Helper</h1>
        <div className="flex items-center space-x-4">
          <button onClick={() => navigate("/")} className="hover:underline">üè† Home</button>
          <button onClick={() => navigate("/login")} className="hover:underline">üîê {t("login")}</button>
          <button onClick={toggleLanguage} className="bg-blue-500 text-white px-4 py-1 rounded-full text-sm">
            üåê {i18n.language === "en" ? "Kiswahili" : "English"}
          </button>
        </div>
      </header>

      {/* Hero Section */}
      <section className="text-center py-20 px-6">
        <h2 className="text-4xl md:text-5xl font-bold mb-6">{t("title")}</h2>
        <p className="max-w-2xl mx-auto text-lg text-gray-100 mb-10">
          {t("description")}
        </p>
        <div className="flex justify-center space-x-4">
          <button
            onClick={() => navigate("/login")}
            className="bg-blue-600 hover:bg-blue-700 px-6 py-3 rounded-md font-semibold shadow"
          >
            üöÄ {t("getStarted")}
          </button>
          <button
            onClick={() => navigate("/register")}
            className="bg-gray-400 hover:bg-gray-500 px-6 py-3 rounded-md font-semibold shadow"
          >
            üÜï {t("createAccount")}
          </button>
        </div>
      </section>

      {/* Features */}
      <section className="bg-white text-gray-800 py-16 px-6">
        <h3 className="text-3xl font-bold text-center mb-12 text-blue-700">{t("featuresTitle")}</h3>
        <div className="grid md:grid-cols-3 gap-10 max-w-6xl mx-auto">
          {features.map((item, idx) => (
            <div key={idx} className="text-center p-6 border rounded-lg bg-white hover:shadow-lg transition">
              <div className="text-5xl mb-4">{item.icon}</div>
              <h4 className="text-xl font-semibold mb-2">{item.title}</h4>
              <p className="text-gray-600 text-sm">{item.description}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer className="bg-gray-100 text-gray-600 text-sm py-4 px-6 flex justify-between">
        <span className="font-semibold">YouWare</span>
        <span>¬© {new Date().getFullYear()} Wayne Nganju</span>
      </footer>
    </div>
  );
}
